{
  "version": "0.2",
  "phases": {
    "install": {
      "commands": [
        "gem install cfn-nag"
      ]
    },
    "build": {
      "commands": [
        "fnames=$(find ./ -type f -name '*.template.json')",
        "for f in $fnames; do cfn_nag_scan --input-path $f; done"
      ]
    }
  }
}

